Luiz Felipe Scolari Luiz Felipe Scolari (* 9. listopadu 1948, Passo Fundo, Brazílie) je brazilský fotbalový trenér. Obsah Hráčská kariéra[editovat | editovat zdroj] Jako hráč byl znám spíše jako nekompromisní obránce, než jako typický brazilský technik. Proto měl také přezdívku perna-de-pau (dřevák). Celou kariéru prožil doma v Brazílii, kde hrál v klubech Caxias, Juventude, Novo Hamburgo a Centro Sportivo Alagoano, se kterým získal svůj jediný titul jako hráč. Trenérská kariéra[editovat | edito
..........
] I přes vysoké porážky v posledních dvou zápasch na šampionátu si chtěl udržet trenérskou funkci u Selecaa (brazilského národního týmu), ale nakonec rezignoval.[4] Portugalsko[editovat | editovat zdroj] V roce 2003 převzal reprezentaci Portugalska, které se chystalo na pořádání EURA 2004. Na úvod základní skupiny sice Scolariho svěřenci podlehli Řecku (1:2), poté však porazili Rusko (2:0) a Španělsko (1:0) a postoupili z prvního místa do vyřazovací části, v ní porazili Anglii 2:2 (6:5 pen) a Ni
